sys_variable_value.value:
(function execute(inputs, outputs) {
    // ... code ...
    var docId = inputs.document_id;
    var admSysID = inputs.process_id;

    var doc_field = new GlideRecord('x_788877_fob_doc_fields');
    doc_field.addQuery('document', docId);
    doc_field.query();

    var payload = new Object();

    while (doc_field.next()) {


        if (doc_field.value_type == "dynamic") { // Campo formulario

            var text = doc_field.field_label.toString().toLowerCase();
            var textFormated = formatString(text);

            var admission = new GlideRecord('x_788877_fob_admissions');
            admission.get(admSysID);

            if (admission && admission.getValue(doc_field.field_name.toString())) {
                payload[textFormated] = admission.getValue(doc_field.field_name.toString());
            }


        } else if (doc_field.value_type == "fixed") { // Campo Fixo

            var text = doc_field.field_label.toString().toLowerCase();
            var textFormated = formatString(text);

            payload[textFormated] = doc_field.fixed_value.toString();
        }

    }

    outputs.data_file = JSON.stringify(payload);



})(inputs, outputs);


function formatString(inputString) {
    // Remove accents using Unicode normalization
    var normalizedString = inputString.normalize('NFD').replace(/[\u0300-\u036f]/g, '');
    // Remove special characters and replace spaces with underscores
    var formattedString = normalizedString.replace(/[^\w\s]+/g, '').replace(/\s+/g, '_').toLowerCase();
    return formattedString;
}

